// import './App.css';
import FilteredList from './FilteredList.js'

function App() {
  const productList = [
    { id: 1, name: "Cute Plant", size: "Medium", type: "Meat", price: 3.99},
    { id: 2, name: "Cute Plant", size: "Medium", type: "Meat", price: 4.99},
    { id: 3, name: "Cute Plant", size: "Medium", type: "Meat", price: 5.99},
    { id: 4, name: "Cute Plant", size: "Medium", type: "Meat", price: 6.99},
    { id: 5, name: "Cute Plant", size: "Medium", type: "Meat", price: 3.99},
    { id: 6, name: "Cute Plant", size: "Medium", type: "Meat", price: 3.99},
    { id: 7, name: "Cute Plant", size: "Medium", type: "Meat", price: 3.99},
    { id: 8, name: "Cute Plant", size: "Medium", type: "Meat", price: 3.99},
    { id: 9, name: "Cute Plant", size: "Medium", type: "Meat", price: 3.99},
    { id: 10, name: "Cute Plant", size: "Medium", type: "Meat", price: 3.99},
    { id: 11, name: "Cute Plant", size: "Medium", type: "Veggie", price: 3.99},
    { id: 12, name: "Cute Plant", size: "Large", type: "Meat", price: 3.99}
   ]   
  return (
    <FilteredList list={productList} />
  );
}

export default App;
